import React, { FunctionComponent, useState } from "react";
import Skin from "../../models/skin";
import SkinDetail from "../skin-detail";

import "./style.css"

type Props = {
    skin: Skin
};

const SkinCard: FunctionComponent<Props> = ({ skin }) => {

    const goToSkin = (id: number) => {
    }

    const [test, setTest] = useState<boolean | null>(null);

    function okbro() {
        (test == null) ? setTest(true) : setTest(null)
    }


    return (
        <li className='card_skin flex-row flex-center-y p15' onClick={() => goToSkin(skin.id)}>
            <div className='flex-col' onClick={okbro}>
                {/* <img src={skin.picture}></img> */}
                <p>{skin.classe}</p>
            </div>
            {test ? (
                <SkinDetail key={skin.id} skin={skin} />
            ) : null}
        </li>
    );
}

export default SkinCard;
